function Fun(a) {
  console.log(a.obj);
  console.log("hello");
  return (
    <>
      <h1>{a.obj.title}</h1>
      <img src="{a.obj.src}" alt="" />
      <p>{a.obj.desc}</p>
    </>
  );
}

export default Fun;
